import React, { useState } from 'react';
import './Attendance.css'; // Import the CSS file for styling

const Attendance = () => {
  const [selectedMedium, setSelectedMedium] = useState('');
  const [selectedSession, setSelectedSession] = useState('');

  const handleMediumChange = (e) => {
    setSelectedMedium(e.target.value);
  };

  const handleSessionChange = (e) => {
    setSelectedSession(e.target.value);
  };

  return (
    <div className="attendance-container">
      <h1 className="attendance-title">Attendance Management</h1>
      <div className="button-container">
        <label htmlFor="mediumInput" className="header-label">Medium:</label>
        <input
          type="text"
          id="mediumInput"
          value={selectedMedium}
          onChange={handleMediumChange}
          className="input-text"
          placeholder="Enter Medium"
        />

        <label htmlFor="sessionInput" className="header-label">Session:</label>
        <input
          type="text"
          id="sessionInput"
          value={selectedSession}
          onChange={handleSessionChange}
          className="input-text"
          placeholder="Enter Session"
        />
      </div>
      {/* Other content related to attendance can go here */}
    </div>
  );
};

export default Attendance;
